import "./PricingCardStyle.css";
import React from 'react'

const PicingCard = () => {
  return (
    <div className="pricing">
      <div className="card-container">
        <div className="card">
            <h3>-Basic-</h3>
        </div>
      </div>
    </div>
  )
}

export default PicingCard
